// UserComponent.tsx
import React from 'react';
import { useUser } from './useUser';

interface UserComponentProps {
  userId: number;
}

const UserComponent = ({ userId }: UserComponentProps) => {
  const { entity, error, isLoading } = useUser(userId);

  if (isLoading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.message}</div>;

  return (
    <div>
      <h1>{entity?.fullName}</h1>
      <p>Email: {entity?.email}</p>
      <p>Admin: {entity?.isAdmin ? 'Yes' : 'No'}</p>
      <p>Super Admin: {entity?.isSuperAdmin() ? 'Yes' : 'No'}</p>
    </div>
  );
};

export default UserComponent;
